import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import Slider, { Range } from 'rc-slider';

import 'rc-slider/assets/index.css';
const wrapperStyle = { width: 400, margin: 50 };
          // <Slider step={20, 'dots'} max={'100'}/>

class SearchProperties extends Component {

  constructor(props) {
    super(props)
    this.state = {
      bedrooms: ''
    }
  }

  onSliderChangeBedrooms = (e) => {
    // console.log(e);
    this.setState({bedrooms: e})
  }

  handleSubmit = () => {

  }

  render(){
    return(
      <div className="searchproperties">


        <form className="search-form-searchproperties" onSubmit={this.handleSubmit}>
          <input id="search-bar-searchproperties" type="text" placeholder="Search suburb e.g. Bronte" />
          <input type="submit" id="submit-searchproperties" />
        </form>


        <div style={wrapperStyle} className="searchBedrooms">
          <p>Min Bedrooms</p>
          <Slider min={0} defaultValue={0} marks={{ 0: 0, 1: 1, 2: 2, 3: 3, 4: 4}} step={null} onChange={this.onSliderChange} max={4} />
        </div>
        <div style={wrapperStyle} className="searchBathrooms">
          <p>Min Bathrooms</p>
          <Slider min={0} defaultValue={0} marks={{ 0: 0, 1: 1, 2: 2, 3: 3, 4: 4}} step={null} onChange={this.onSliderChange} max={4} />
        </div>
        <div style={wrapperStyle} className="maxPrice">
          <p>Max Price ($m)</p>
          <Slider min={1000000} defaultValue={1000000} marks={{ 1000000: 1 , 2000000: 2 , 3000000: 3 , 5000000: 5 , 10000000: 10 }} step={null} onChange={this.onSliderChangeBedrooms} max={10000000} />
        </div>

      </div>
    )
  }
}

export default SearchProperties
